  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'mdx',
	title: 'Powered by MDX'
};
export const metadata = {
  "unversionedId": "mdx",
  "id": "mdx",
  "isDocsHomePage": false,
  "title": "Powered by MDX",
  "description": "You can write JSX and use React components within your Markdown thanks to MDX.",
  "source": "@site/docs/mdx.md",
  "permalink": "/docs/mdx",
  "editUrl": "https://github.com/facebook/docusaurus/edit/master/website/docs/mdx.md"
};
  /* @jsx mdx */

export const rightToc = [];
export const Highlight = ({
  children,
  color
}) => <span style={{
  backgroundColor: color,
  borderRadius: '2px',
  color: '#fff',
  padding: '0.2rem'
}}>{children}</span>;

const layoutProps = {
  rightToc,
Highlight
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`You can write JSX and use React components within your Markdown thanks to `}<a parentName="p" {...{
        "href": "https://mdxjs.com/"
      }}>{`MDX`}</a>{`.`}</p>

    <Highlight color="#25c2a0" mdxType="Highlight">Docusaurus green</Highlight> and <Highlight color="#1877F2" mdxType="Highlight">Facebook blue</Highlight> are my favorite colors.
    <p>{`I can write `}<strong parentName="p">{`Markdown`}</strong>{` alongside my `}<em parentName="p">{`JSX`}</em>{`!`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
